import React, { useEffect } from 'react';
import styled from 'styled-components';
import { useGlobalContext } from '../../context/globalContext';
import History from '../../History/History';
import { InnerLayout } from '../../styles/layouts';
import { dollar } from '../../utils/Icon';
import Chart from '../Chart/Chart';

export default function Dashboard() {
  const { 
    totalExpenses, 
    incomes, 
    expenses, 
    totalIncome, 
    totalBalance, 
    getIncomes, 
    getExpenses 
  } = useGlobalContext();

  useEffect(() => {
    getIncomes();
    getExpenses();
  }, []);

  return (
    <div>
      <DashboardStyled>
        <InnerLayout>
          <h1>All Transactions</h1>
          <div className="stats-con">
            <div className="chart-con">
              <Chart />
              <div className="amount-con">
                <div className="income">
                  <h2>Total Income</h2>
                  <p>
                    {dollar} {totalIncome()}
                  </p>
                </div>
                <div className="expense">
                  <h2>Total Expense</h2>
                  <p>
                    {dollar} {totalExpenses()}
                  </p>
                </div>
                <div className="balance">
                  <h2>Total Balance</h2>
                  <p>
                    {dollar} {totalBalance()}
                  </p>
                </div>
              </div>
            </div>

            <div className="history-con">
                        <History />
                        <h2 className="salary-title-1">Min <span>Salary</span>Max</h2>
                        <div className="salary-item">
                            <p>
                                { dollar }{Math.min(...incomes.map(item => item.amount))}
                            </p>
                            <p>
                               { dollar }{Math.max(...incomes.map(item => item.amount))}
                            </p>
                        </div>
                        <h2 className="salary-title-2">Min <span>Expense</span>Max</h2>
                        <div className="salary-item">
                            <p>
                                { dollar }{Math.min(...expenses.map(item => item.amount))}
                            </p>
                            <p>
                                { dollar }{Math.max(...expenses.map(item => item.amount))}
                            </p>
                        </div>
                    </div>
          </div>
        </InnerLayout>
      </DashboardStyled>
    </div>
  );
}

const DashboardStyled = styled.div`
    .stats-con{
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        gap: 2rem;
        .chart-con{
            grid-column: 1 / 4;
            height: 300px;
            .amount-con{
                display: grid;
                grid-template-columns: repeat(4, 1fr);
                gap: 2rem;
                margin-top: 2rem;
                .income, .expense{
                    grid-column: span 2;
                }
                .income, .expense, .balance{
                    background: #FCF6F9;
                    border: 2px solid #FFFFFF;
                    box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
                    border-radius: 20px;
                    padding: 1rem;
                    p{
                        font-size: 2.5rem;
                        font-weight: 700;
                    }
                }
                .expense{
                color: var(--color-red);
                }
                .balance{
                    grid-column: 1 / 5;
                    display: flex;
                    flex-direction: column;
                    justify-content: center;
                    align-items: center;
                    margin-bottom: .2rem;
                    p{
                        color: var(--color-green);
                        opacity: 0.9;
                        font-size: 3.2rem;
                    }
                }
            }
        }

        .history-con{
            grid-column: 4 / -1;
            h2{
                margin: 1rem 0;
                display: flex;
                align-items: center;
                justify-content: space-around;
            }
            .salary-title-1{
                font-size: 1rem;
                span{
                    font-size: 1.5rem;
                    color: var(--color-green);
                }
            }
                .salary-title-2{
                font-size: 1rem;
                span{
                    font-size: 1.5rem;
                    color: var(--color-red);
                }
            }
            .salary-item{
                background: #FCF6F9;
                border: 2px solid #FFFFFF;
                box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
                padding: 1rem;
                border-radius: 20px;
                display: flex;
                justify-content: space-between;
                align-items: center;
                p{
                    font-weight: 700;
                    font-size: 1.2rem;
                }
            }
        }
    }
`;
